sessions.session_desc:
The NASCAR iRacing Class A Series boasts head-to-head competition between three world class manufacturers with the NASCAR Cup Series Chevrolet Camaro, Ford Mustang and Toyota Camry in iRacing's top level regular season stock car series. The series features the best-known stock-car racing venues, from short tracks to intermediates, speedways to superspeedways. 

 {br}{br} 

 Introduced for the 2022 season, the NASCAR Cup Series Next Gen cars are built to the latest stock car rules and feature the current aerodynamic configuration. Success in the Chevy, Ford or Toyota will go to the drivers who are able to set-up their cars appropriately for this wide range of circuits... and then drive the wheels off 'em. While a majority of the events are shorter than their real-world counterparts, four races per season are run to their full Cup lengths, starting with February's Daytona 500.
